    "Advanced Microgravity Compatible, Integrated Laundry System Project",nt"tracking_summary":
    {ntt"total": 13,ntt"recent": 4nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:20:21.801823",nt"name": "advanced-microgravity-compatible-integrated-laundry-system-project",nt"isopen":
    true,nt"url": null,nt"notes": "An Advanced Microgravity Compatible, Integrated
    laundry System (AMCILS) is proposed that uses a two phase water / water vapor system
    to allow good agitation of clothing during the wash &amp; rinse cycle.  Drying will
    be accomplished utilizing microwave energy addition and "jet" air flow to fluff
    and move clothing in the washing chamber.  Operation in a two phase water / water
    vapor system precludes the formation of sustainable foam in the wash effluent while
    allowing adequate volume for agitation of clothing in a weightless environment while
    using a minimum amount of water.  Drying using air "jets" and microwave addition
    was proven during micro-gravity testing performed in the Single Phase Space Laundry
    Phase II program (NASA contract No. NAS9-18362, Jan. 1993) The Phase II effort will
    build upon the successful Phase I feasibility demonstration of the AMCIL concept
    and result in delivery of a working AMCIL prototype whose performance will be thoroughly
    characterized and delivered to NASA for independent testing.  rntThe AMCIL promises
    a reduction in ESM associated with crew clothing on long duration missions through
    the reduction of expendables.  Clothing can be re-used which minimizes ESM associated
    with storage of new clothing, and waste storage associated with used clothing.",nt"license_title":
